import React, { Component } from "react";
import "./Footer.css";

import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faFacebookMessenger,
  faFacebookF,
  faInstagram
} from "@fortawesome/free-brands-svg-icons"

class Footer extends Component {
  render() {
    return (
      <div className="footer-container">
        <div>
          <span>Find us on:</span>
          <br />
          <FontAwesomeIcon
            icon={faInstagram}
            style={{ width: 40, height: 40 }}
          />
          <FontAwesomeIcon
            icon={faAddressCard}
            style={{ width: 40, height: 40 }}
          />
          <FontAwesomeIcon
            icon={faPhoneSquareAlt}
            style={{ width: 40, height: 40 }}
          />
        </div>
        <span className="title-footer">
          © 2009–2019 Zappos LLC or its affiliates, 400 East Stewart Avenue. Las
          Vegas NV 89101
        </span>
        <br />
        <span className="title-footer">
          6pm.com is operated by Zappos IP LLC. Products on 6pm.com are sold by
          6pm.com, LLC.
        </span>
        <br />
        <span className="title-footer">
          e-Gift Cards on 6pm.com are sold by ACI Gift Cards LLC.
        </span>
        <br />
        <span className="title-footer">
          For premier service, selection, and shipping, visit Zappos.com — your
          one-stop shop for the latest in Shoes, Sandals, Dresses, Jeans and
          more!
        </span>
        <br />
        <span className="title-footer">
          For luxury and designer styles, visit Zappos Luxury.
        </span>
        <br />
      </div>
    );
  }
}

export default Footer;
